import React from 'react';
import { Link, useNavigate } from 'react-router-dom';

const UserProfile = ({ setToken }) => {
  const navigate = useNavigate();

  const handleLogout = () => {
    localStorage.removeItem('token');
    setToken(null);
    navigate('/'); // Send them back to Login
  };

  return (
    <div style={{ maxWidth: '500px', margin: '30px auto', fontFamily: 'Arial, sans-serif' }}>
      
      {/* 1. Back Button */}
      <Link to="/" style={{ textDecoration: 'none', color: '#555', display: 'block', marginBottom: '20px' }}>
        ‚Üê Back to Menu
      </Link>

      {/* 2. Profile Header (Avatar + Name) */}
      <div style={{ textAlign: 'center', marginBottom: '40px' }}>
        <img 
          src="https://cdn-icons-png.flaticon.com/512/3135/3135715.png" 
          alt="Profile" 
          style={{ width: '120px', height: '120px', borderRadius: '50%', border: '4px solid #2ecc71', marginBottom: '15px' }} 
        />
        <h2 style={{ margin: 0, color: '#2c3e50' }}>Chef Master</h2>
        <p style={{ color: '#777' }}>student@example.com</p>
      </div>

      {/* 3. The Menu Options (List) */}
      <div style={{ background: 'white', borderRadius: '15px', boxShadow: '0 4px 15px rgba(0,0,0,0.05)', overflow: 'hidden' }}>
        
        {/* Favorites Option */}
        <div style={styles.menuItem}>
          <span style={{ fontSize: '20px' }}>‚ù§Ô∏è</span>
          <div style={{ marginLeft: '15px', flex: 1 }}>
            <h4 style={{ margin: 0 }}>My Favorites</h4>
            <p style={{ margin: 0, fontSize: '12px', color: '#999' }}>View your saved recipes</p>
          </div>
          <span style={{ color: '#ccc' }}>‚Ä∫</span>
        </div>

        {/* History Option (Placeholder) */}
        <div style={styles.menuItem}>
          <span style={{ fontSize: '20px' }}>üìú</span>
          <div style={{ marginLeft: '15px', flex: 1 }}>
            <h4 style={{ margin: 0 }}>Order History</h4>
            <p style={{ margin: 0, fontSize: '12px', color: '#999' }}>Past meals cooked</p>
          </div>
          <span style={{ color: '#ccc' }}>‚Ä∫</span>
        </div>

        {/* Settings Option (Placeholder) */}
        <div style={styles.menuItem}>
          <span style={{ fontSize: '20px' }}>‚öôÔ∏è</span>
          <div style={{ marginLeft: '15px', flex: 1 }}>
            <h4 style={{ margin: 0 }}>Settings</h4>
            <p style={{ margin: 0, fontSize: '12px', color: '#999' }}>Account preferences</p>
          </div>
          <span style={{ color: '#ccc' }}>‚Ä∫</span>
        </div>

        {/* Logout Option */}
        <div onClick={handleLogout} style={{ ...styles.menuItem, borderBottom: 'none', cursor: 'pointer', background: '#fff5f5' }}>
          <span style={{ fontSize: '20px' }}>üö™</span>
          <div style={{ marginLeft: '15px', flex: 1 }}>
            <h4 style={{ margin: 0, color: '#e74c3c' }}>Logout</h4>
            <p style={{ margin: 0, fontSize: '12px', color: '#e74c3c' }}>Sign out of your account</p>
          </div>
        </div>

      </div>

    </div>
  );
};

// Simple Styles for the list items
const styles = {
  menuItem: {
    display: 'flex',
    alignItems: 'center',
    padding: '20px',
    borderBottom: '1px solid #eee',
    cursor: 'pointer',
    transition: 'background 0.2s'
  }
};

export default UserProfile;
